import React, { useState, useEffect } from "react";
import '../style/main.css';

function Histoire() {
  const [histoire, setHistoire] = useState(null);

  useEffect(() => {
    fetch('http://localhost:5000/api/histoire')
      .then(response => response.json())
      .then(data => {
        setHistoire(data.histoire);
      })
      .catch(error => {
        console.error('Erreur lors de la récupération des données d\'histoire:', error);
      });
  }, []);

  return (
    <div className="main-container">
      <div className="description-box">
        <h1>Histoire</h1>
        {histoire && (
          <>
            {/* Présentation générale */}
            <section className="section">
              <h2>{histoire.introduction.titre}</h2>
              <p>{histoire.introduction.contenu}</p>
            </section>

            {/* Partie 1 - L'Origine de l'Apocalypse */}
            <section className="section">
              <h2>{histoire.partie1.titre}</h2>
              <div className="sub-section">
                <h3>{histoire.partie1.chapitre1.titre}</h3>
                <p>{histoire.partie1.chapitre1.contenu}</p>
                {/* Jeu contenu */}
                <p className="italic">{histoire.partie1.chapitre1.jeu_contenu}</p>
              </div>
              <div className="sub-section">
                <h3>{histoire.partie1.chapitre2.titre}</h3>
                <p>{histoire.partie1.chapitre2.contenu}</p>
                {/* Jeu contenu */}
                <p className="italic">{histoire.partie1.chapitre2.jeu_contenu}</p>
              </div>
            </section>

            {/* Partie 2 - Les Personnages Survivants */}
            <section className="section">
              <h2>{histoire.partie2.titre}</h2>
              <div className="sub-section">
                <h3>{histoire.partie2.chapitre1.titre}</h3>
                <p>{histoire.partie2.chapitre1.contenu}</p>
                {/* Jeu contenu */}
                <p className="italic">{histoire.partie2.chapitre1.jeu_contenu}</p>
              </div>
              <div className="sub-section">
                <h3>{histoire.partie2.chapitre2.titre}</h3>
                <p>{histoire.partie2.chapitre2.contenu}</p>
                {/* Jeu contenu */}
                <p className="italic">{histoire.partie2.chapitre2.jeu_contenu}</p>
              </div>
            </section>

            {/* Partie 3 - La Vie Sous AM */}
            <section className="section">
              <h2>{histoire.partie3.titre}</h2>
              <div className="sub-section">
                <h3>{histoire.partie3.chapitre1.titre}</h3>
                <p>{histoire.partie3.chapitre1.contenu}</p>
                {/* Jeu contenu */}
                <p className="italic">{histoire.partie3.chapitre1.jeu_contenu}</p>
              </div>
              <div className="sub-section">
                <h3>{histoire.partie3.chapitre2.titre}</h3>
                <p>{histoire.partie3.chapitre2.contenu}</p>
                {/* Jeu contenu */}
                <p className="italic">{histoire.partie3.chapitre2.jeu_contenu}</p>
              </div>
            </section>

            {/* Partie 4 - Les Thèmes et Symbolismes */}
            <section className="section">
              <h2>{histoire.partie4.titre}</h2>
              <div className="sub-section">
                <h3>{histoire.partie4.chapitre1.titre}</h3>
                <p>{histoire.partie4.chapitre1.contenu}</p>
                {/* Jeu contenu */}
                <p className="italic">{histoire.partie4.chapitre1.jeu_contenu}</p>
              </div>
              <div className="sub-section">
                <h3>{histoire.partie4.chapitre2.titre}</h3>
                <p>{histoire.partie4.chapitre2.contenu}</p>
                {/* Jeu contenu */}
                <p className="italic">{histoire.partie4.chapitre2.jeu_contenu}</p>
              </div>
            </section>

            {/* Partie 5 - La Conclusion */}
            <section className="section">
              <h2>{histoire.partie5.titre}</h2>
              <div className="sub-section">
                <h3>{histoire.partie5.chapitre1.titre}</h3>
                <p>{histoire.partie5.chapitre1.contenu}</p>
                {/* Jeu contenu */}
                <p className="italic">{histoire.partie5.chapitre1.jeu_contenu}</p>
              </div>
              <div className="sub-section">
                <h3>{histoire.partie5.chapitre2.titre}</h3>
                <p>{histoire.partie5.chapitre2.contenu}</p>
                {/* Jeu contenu */}
                <p className="italic">{histoire.partie5.chapitre2.jeu_contenu}</p>
              </div>
            </section>

            {/* Fins du Jeu */}
            <section className="section">
              <h2>{histoire.finsDuJeu.titre}</h2>
              <p>{histoire.finsDuJeu.contenu}</p>
              {/* Jeu contenu */}
              <p className="italic">{histoire.finsDuJeu.jeu_contenu}</p>
            </section>
          </>
        )}
      </div>
    </div>
  );
}

export default Histoire;
